import React from "react";
import "./App.css";
import Header from "./Header/Header";
import SideBar from "./SideBar/SideBar";
import Body from "./Body/Body";
import {Route, Routes} from "react-router-dom";
export default function App(){
    return(
        <>
        <Routes>
            <Route exact path="/">        
         <div className="main">
            <Body />
            <Header />
            <SideBar />
         </div>

            </Route>
            
        </Routes>

        </>
    );
}
